<html><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8"><meta name="Version" content="NPD6301-00 ET"><title>Kui printeri juhtpaneel ei vasta</title><link href="files/_sdisc07.css" rel="stylesheet"></head><body><a name="GUID-70B2372D-A940-4E26-8432-C75845B0EB2A"></a><h3>Kui printeri juhtpaneel ei vasta</h3><div class="body">
		<div class="section" id="GUID-F9F091C9-6F93-4177-A9C0-3D1881E8A4E4">
			<div class="itemiz" id="UL_7B2C3223EF9B4564B8F4C8529E111753">
				
					<div class="bullet" id="GUID-DF557BF7-5AF7-480D-AFF8-709E61D63810">Kui printer kuvab teated "Tindisüsteemi ettevalmistamine" või "Printimine...", oodake kuni protsess lõpeb.</div>
				
				
					<div class="bullet" id="GUID-805BA9EB-21DC-49CA-89B1-E1512516C86F">Vajutage mistahes nuppe, välja arvatud nupp <img src="../images/GUID-37BF667C-1DEB-4668-9DC2-18D839B998E1-web.png" border="0">, kui printeri juhtpaneel on väljas.</div>
				
				
					<div class="bullet" id="GUID-B24637FA-1639-4723-9F0A-2ABF1E3BFB40">Vajutage nuppu <img src="../images/GUID-F38CED8D-5F92-4EC5-B844-D872D3112E8E-web.png" border="0">, et naasta avakuvale.</div>
				
			</div>
		</div>
	</div></body></html>
